import {VoteComponent} from '../voteComponent/voteComponent';
export const HotelComponent = ({hotels})=>{
    console.log(hotels)
    return (
        <div>
            <ul>
                {hotels.map((hotel)=>{

                    return(
                        <>
                            <li key={hotel.id}>
                                {hotel.name}
                            <VoteComponent services={hotel.services}/>

                            </li>
                        </>
                    )

                })}
            </ul>
        </div>
    )
}
